import styled from "styled-components";

const ContactInfo = styled.div`
  background: #e4e4e4;
  display: columns;
  align-items: center;
`;

const Contact = () => {
  return (
    <ContactInfo>
      <h1>Contact</h1>
      <h3>Let's create your next experience together</h3>
      <h2>hallam.fulcher@gmail.com</h2>
    </ContactInfo>
  );
};

export default Contact;
